import Categories from "../components/Categories";
import style from './style.css'
import axios from "axios";
import { useEffect, useState } from "react";
import { RiMenuLine } from "react-icons/ri";
import { Link } from "react-router-dom";
import LandingPage from "../components/LandingPage";


const Main = () => {
    const [categories, setCategories] = useState([]);
    const [loaded, setLoaded] = useState(false);
    const [sidebarOpen, setSideBarOpen] = useState(false);
    const [currCat, setCurrCat] = useState("");
    const [catMeals, setCatMeals] = useState([]);
    const [ready, setReady] = useState(false);
    const [areas, setAreas] = useState([]);
    const [loadedToo, setLoadedToo] = useState(false);
    const [meal, setMeal] = useState([]);
    const [finish, setFinish] = useState(false);
    const [currIngred, setCurrIngred] = useState([]);
    const [currAmt, setCurrAmt] = useState([]);


    useEffect(() => {
        axios.get('https://www.themealdb.com/api/json/v1/1/categories.php')
            .then(res=> { 
                setCategories(res.data.categories)
                setLoaded(true);
            })
            .catch(err => console.error(err))
    }, []);

    useEffect(() => {
        axios.get('https://www.themealdb.com/api/json/v1/1/list.php?a=list')
            .then(res=> { 
                setAreas(res.data.meals)
                setLoadedToo(true);
            })
            .catch(err => console.error(err))
    }, []);


    const currentCat = (value) => {
        axios.get(`https://www.themealdb.com/api/json/v1/1/filter.php?c=${value}`)
            .then(res=> {
                setCurrCat(value)
                setCatMeals(res.data.meals)
                setReady(true);
            })
            .catch(err=>console.error(err))
    }

    const handleViewSidebar = () => {
        console.log(sidebarOpen)
        if(sidebarOpen == false){
            setSideBarOpen(true);
        }
        if(sidebarOpen == true) {
            setSideBarOpen(false);
        }
    };

    const currMeal = (value) => {
        axios.get(`https://www.themealdb.com/api/json/v1/1/lookup.php?i=${value}`)
            .then(res=> {
                setMeal(res.data.meals[0])
                setFinish(true);
                let ingredients = []
                for(let i=1; i<=20; i++){
                    for(const [key, value] of Object.entries(meal)){
                        let single = "strIngredient" + i;
                        if(key === single){
                            if(value !== '' && value !== null){
                                ingredients.push(`${value}`)
                            }
                        }
                    }
                }
                setCurrIngred(ingredients);
                let measure = [];
                for(let i=1; i<=20; i++){
                    for(const [key, value] of Object.entries(meal)){
                        let singleVal = "strMeasure" + i;
                        if(key === singleVal){
                            if(value !== '' && value !== null){
                                measure.push(`${value}`)
                            }
                        }
                    }
                }
                setCurrAmt(measure);
            })
            .catch(err=>console.error(err))
    }



    return(
        <div>
            {finish && meal ? 
            <div className="Sidebar">
                <div className="sidebar-header">
                    <RiMenuLine className="sidebar-icon sidebar-burger" onClick={handleViewSidebar}/>
                    <h1 className="sidebar-logo">{meal.strMeal.toUpperCase()}</h1>
                </div>
                <div key={i} className="sidebar-items">
                    <Link className="header-link" onClick={(e)=>{currentCat(cat.strCategory)}}>
                    <div className="item">
                        <img src={cat.strCategoryThumb} id="menupic" alt="category" className="sidebar-icon"/>
                        <span className="sidebar-text">{cat.strCategory}</span>
                    </div>
                    </Link>
                </div>
            </div> : <></> }
            <div className="flex sp-btw header">
                <div className="burger marg-left-20">
                    <RiMenuLine onClick={handleViewSidebar} className="sidebar-icon" id="RiMenuLine"/>
                </div>
                <div>
                    <h2 className="header-link center">QUICK & EASY RECIPES</h2>
                </div>
                <div>
                </div>
            </div>
            <div>
                <LandingPage categories={categories} areas={areas}/>
            </div>
            {/* <div>
                {loaded && <Categories categories={categories} ready={ready} catMeals={catMeals} currCat={currCat}/>}
            </div> */}
        </div>
    )
}

export default Main;
